aws-native:ssm:Document.description:
The AWS::SSM::Document resource is an SSM document in AWS Systems Manager that defines the actions that Systems Manager performs, which can be used to set up and run commands on your instances.

{{% examples %}}
## Example Usage
{{% example %}}
### Example
```csharp
using Pulumi;
using AwsNative = Pulumi.AwsNative;

class MyStack : Stack
{
    public MyStack()
    {
        var sessionPreferencesDocument = new AwsNative.SSM.Document("sessionPreferencesDocument", new AwsNative.SSM.DocumentArgs
        {
            Name = "SSM-SessionManagerRunShell",
            Content = 
            {
                { "schemaVersion", "1.0" },
                { "description", "Document to hold regional settings for Session Manager" },
                { "sessionType", "Standard_Stream" },
                { "inputs", 
                {
                    { "s3BucketName", "DOC-EXAMPLE-BUCKET" },
                    { "s3KeyPrefix", "MyBucketPrefix" },
                    { "s3EncryptionEnabled", true },
                    { "cloudWatchLogGroupName", "MyLogGroupName" },
                    { "cloudWatchEncryptionEnabled", true },
                    { "cloudWatchStreamingEnabled", false },
                    { "kmsKeyId", "MyKMSKeyID" },
                    { "runAsEnabled", false },
                    { "runAsDefaultUser", "MyDefaultRunAsUser" },
                    { "idleSessionTimeout", "20" },
                    { "shellProfile", 
                    {
                        { "windows", "example commands" },
                        { "linux", "example commands" },
                    } },
                } },
            },
            DocumentType = "Session",
        });
        this.DocumentName = "SSM-SessionManagerRunShell";
    }

    [Output("documentName")]
    public Output<string> DocumentName { get; set; }
}

